(96, 50, 816, 845, 19, '5', 87, '2019-12-10 14:44:27'),
(97, 51, 816, 813, 19, 'In the group, he did the Long-term Orientation part and found information about IKEA Thailand to contribute to the assignment. He always completes his weekly deadlines on time and is always at meetings. Because we chose Thailand and The UK for our analysis, he has the advantage of finding information in Thai and always assisting other members in sourcing to complete the paper. He is always sociable, listening to the opinions of other members and trying to find solutions to get things done on time. He has contributed ideas but has not really taken the initiative in giving ideas. He tries to make a connection with other members as well as tries to practice presentations to make it cohesive parts.', 87, '2019-12-10 14:44:27'),
(98, 51, 816, 816, 19, 'In the group, I did the Introduction and Uncertainty avoidance dimension part with the analysis of Maslow and Vroom theory and information about IKEA in the UK. The conclusion part was the contribution of all the members of the group. After working as a team, I found myself improving my productivity and increasing my work flexibility, thereby improving the quality of the assignment. Many new ideas were brought up and the connection of team members was increased. General work is driven by a commitment to weekly deadlines, thereby motivating members to complete the assignment on time. Thereby I worked more actively with others, expressed my personal responsibility as well as more effectively communicated with a wide range of audiences. I also learned how to resolve conflicts within the group, when members from different countries with different cultures by trying to listen and find similarities between opinions. I learned about how to give cohesion group presentations for a limited time with engaging with other members.', 87, '2019-12-10 14:44:27'),
(99, 51, 816, 819, 19, 'In the group, she did the Introduction, Individualism part and find information about IKEA Thailand to contribute the assignment. She also has the advantage of finding information in Thai and always assisting other members in sourcing to complete the paper. She is an enthusiastic member, always gets her work done on time and presents at all meetings. She has a good connection with the members and always tries to resolve conflicts within the group. She is the synthesizer of all members\' parts, and then when the parts have problems, all members can edit together and make it cohesive to a complete post. She is always proactive in giving opinions and receiving positive feedback. She also made efforts to practise group presentations.', 87, '2019-12-10 14:44:27'),
(100, 51, 816, 825, 19, 'In the group, she did the Power distance part and found information about IKEA in the UK to contribute to the assignment. She always completes her weekly deadlines on time and is always at meetings. Yu is always sociable, listening to the opinions of other members and trying to find solutions to get things done on time. She has contributed ideas but has not really taken the initiative in giving ideas. She tries to make a connection with other members as well as tries to practice presentations to make it cohesive parts. She participated in contributing to our group work.', 87, '2019-12-10 14:44:27'),
(101, 51, 816, 845, 19, 'In the group, he did the Masculinity, Indulgence part and find information about IKEA in the UK to contribute the assignment. He was present at the meetings but sometimes he did not finish his work by the weekly deadline. He has not been proactive in giving his opinions when he had problems and sometimes we had a few difficulties when he followed the different ways to approach. However, in the end, he listened to the opinions of other members and tried his best to complete his part as well as made effort to practice the group presentation with other members.', 87, '2019-12-10 14:44:27'),
