(145, 50, 882, 894, 19, '7', 81, '2019-12-11 02:12:43'),
(146, 51, 882, 882, 19, 'During my work with this team, I seized the opportunity to become a better team player during the discussions and brainstorming, and to express my opinion in a way that is understandable to the team. I also developed my problem-solving skills by taking the advice and instructions of our lecturers, which led to a reformulation and better structuring the work we did as a team. Besides, it can be said that when the team is homogeneous, and everyone has clear responsibilities, this leads to the success and completion of the work with more accuracy. The major part I participated in was finding information related to the case study and the design of the presentation.  ', 81, '2019-12-11 02:12:43'),
(147, 51, 882, 885, 19, 'When I met Osei for the first time I got an impression that he is an introvert, which might limit his contribution to the team, but he turned out to be very helpful and according to Belbin Team Roles he possessed the qualities of an implementer and a team worker, he attended all our group meetings, did not show any hesitation and initiated the request for some parts of the work to be assigned to him related to cultural theories and outlining motivation of US employees. He accomplished all the tasks assigned to him successfully and it gave me the lesson not to judge people from the first impression. He is appreciated for embracing the team comments regarding reading his outline from the slides and he showed confidence during the presentation. ', 81, '2019-12-11 02:12:43'),
(148, 51, 882, 888, 19, 'Olga is a leader by nature, it is not the first time to participate with her in a team. She is an excellent team player and a commander at the same time, according to Belbin Team Roles she has the qualities of a shaper, coordinator and a complete finisher. She participated dynamically in shaping the outline of the presentation, coordinating the process of assigning responsibilities and jobs between the team members and posting it in on the social media group after every group meeting. She successfully accomplished her assigned work related to motivation and motivation theories.\r\nAfter finalizing our slides, she critically proofread every slide and gave comments as well as helping in modifying slides for final submission.  ', 81, '2019-12-11 02:12:43'),
(149, 51, 882, 894, 19, 'Achraf was the mind and the spirit of the group he has the qualities of a research investigator and a specialist according to Belbin Team Roles; he is an expert in technology and computer software and he is the one who formed our social media group and our file sharing group on google drive. He is hardworking and precise in his search for information. Besides, he did not hesitate to provide general assistance and help to any of the team members. His skills gave him the ability to be the fastest in acquiring most information related to critical thinking, building arguments and ended up filling half of the powerpoint slides.', 81, '2019-12-11 02:12:43'),
(150, 50, 888, 882, 19, '6', 81, '2019-12-11 02:36:28'),
(151, 50, 888, 885, 19, '6', 81, '2019-12-11 02:36:28'),
(152, 50, 888, 888, 19, '6', 81, '2019-12-11 02:36:28'),
(153, 50, 888, 894, 19, '7', 81, '2019-12-11 02:36:28'),
(154, 51, 888, 882, 19, 'Hamida is a well organised person with high organisational and research skills. She made a serious research for our case study and found useful sources of information. She was making big contribution on all the stages of work starting from sharing the very first ideas and choosing a company for the case study to the latest stages of rehearsal process. She never missed any team meetings, was always involved into the discussion and proposed lots of ideas. She drafted the design of our presentation, helped with organising slides in appropriate order and always was very supportive. More practice in public presentations should help her to become less nervous during speaking in public, and this is the only thing I wish her to improve. ', 81, '2019-12-11 02:36:28'),
(155, 51, 888, 885, 19, 'Osei is a well organised team member having good research and analytical skills. He is able to present information systematically and in well-structured manner. He found several helpful sources of information, participated in drafting and finalising the presentation. He was present at all the team meetings and was involved into all the stages of team work. I would prefer him to be a bit more involved into communication process and a bit less introverted. This could enrich the team work as the brainstorming process usually benefits from all the opinions being heard. It could also be of big help if Osei wouldn’t be shy to propose ideas and initiate things as he has got good analytical skills which could be helpful for structuring information in the presentation. ', 81, '2019-12-11 02:36:28'),
(156, 51, 888, 888, 19, 'After finishing this project, I realised that team work does depend on the level of all the team members commitment. In our team, all members were supportive and focused on the task while in my previous experience it not always worked like this. If all team members are focused on their parts of the job, it motivates you to perform even better.\r\nThis project and my colleagues’ approaches have proved to me that using several sources of information regarding the same issue can be of good help to identify the trends in the researched field.\r\n', 81, '2019-12-11 02:36:28'),
(157, 51, 888, 894, 19, 'Achraf has excellent research skills, good understanding of how information in academic piece of work should be structured and presented. He contributed to the team work a lot and never missed team meetings. He made serious research for our topic and found many sources of information that we used in our presentation. He contributed to the creation of the presentation flow and proposed some ideas on the design. He was deeply involved into the team work on all the stages from drafting the ideas to rehearsal process. The only thing he could improve is the presentation skills. He has everything to become more self-confident and less nervous while speaking in public. His strong analytical skills and good memory can always become a good platform for being a confident presenter.', 81, '2019-12-11 02:36:28'),
(158, 50, 891, 880, 19, '8', 79, '2019-12-11 05:53:41'),
(159, 50, 891, 884, 19, '8', 79, '2019-12-11 05:53:41'),
(160, 50, 891, 886, 19, '8', 79, '2019-12-11 05:53:41'),
(161, 50, 891, 891, 19, '8', 79, '2019-12-11 05:53:41'),
(162, 51, 891, 880, 19, 'With a great love for the team this member attended almost all the meetings and contributed meaningfully during discussions. She created a WhatsApp platform which enhances communication within the team. Her part of assignment was to put every work done and agreed by the team together by proof reading and putting final touches to it. \r\nOn the agreement of the team to use Prezi for presentation, she created it and have all the works copied into it, the work on Prezi was analysed and accepted by the Team as our work.  This member was in charge of the group communication as she also liaises between the group and the Lecturers, without appointment she fills up the leadership vacuum of the team and it was successful as she respectfully addresses every member during our contact and was not domineering. Her personality contributed to the successful delivery of the Team task.\r\n', 79, '2019-12-11 05:53:41'),
(163, 51, 891, 884, 19, 'This Team member attended all the Group meetings and contributed in every discussion with passion. The Group work was divided equally among the members, two countries were picked by the Team and her part was to find out how one of those countries manages their employees on the aspect of motivation. This member also searched for the effect of culture in the management and motivation of employees especially on the fact that the organization does not originate from the said country. Her findings were examined and adjusted by the Team as usual and finally accepted it to be part of the groups submitted work. She was gentle, time conscious, considerate and dedicated member. These her qualities enabled the Team to work successfully without crises', 79, '2019-12-11 05:53:41'),
(164, 51, 891, 886, 19, 'She contributed as much as she could and attended all the Group meetings with great zeal.\r\nAt the inaugural meeting, the Group choose to work on assignment number one and asked every member to go and search for a company and countries. This team member’s choice of company was accepted by the Team after scrutinizing every other company brought by members.\r\nThe Group work was divided into four equal parts and hers was to compare the two countries chosen by the Team using Hofstede cross cultural dimension as agreed by the members. She delivered at the agreed time. The Group studied her submission, made some corrections and accepted the work as part of the Groups’ submitted work. This member is confident, has a peaceful spirit which helped the Team to work together, her search engine skills also contributed to the success of the Group.\r\n', 79, '2019-12-11 05:53:41'),
(165, 51, 891, 891, 19, 'Meeting with the team was so interacting and educating, I learnt how to use Prezi for presentations, my communication improved. Team members are respectful, dedicated and loving. Passionately I carried out my part of assignment which was getting general information on our company and one of the chosen countries which happens to be the country of origin of the organization we are working on. Studying and understanding how the employees were motivated in that country as well as the impact of culture in the process was a big achievement to me. My work was submitted at the right time, the group examined and had their input before it became part of our submitted work.\r\nDelivery my part of assignment improved my leadership proficiencies as we were meant to be totally responsible for a part assigned to you. My research skills are enhanced and my presentation skills boosted.\r\n', 79, '2019-12-11 05:53:41'),
