(173, 50, 887, 889, 19, '8', 80, '2019-12-11 06:02:46'),
(174, 51, 887, 881, 19, 'Kayode was very active, highly  contributed to this assignment ,good research skills ,confident  and gives feedback on time  with no excuses for not coming to group meetings. Additionally ,Kayode was very supportive  and had a good communication skill which was very impactful to this assignment outcome. He was highly reliable  during this work. Kayode was very organised in making sure we achieved all our set objectives .He was always ready to adjust to any changes made without complaining.Futhermore , he was very respectful to everyone ,listens to everyone which prevented group conflict as most time everyone respected each other opinion.\r\n', 80, '2019-12-11 06:02:46'),
(175, 51, 887, 883, 19, 'Malene was highly involved during this group work, she gave extensive feedback from her research work on time fully participated during meetings .she  was very open ,confident listens to everyone had a good technical skill from which I learnt a lot from .she was very creative and displayed good critical thinking skills and focused on the team achieving our goal .Malene portrayed a good communication skills which was highly important for this assignment. She was highly dedicated to the group work ,organised  and ensured we achieved our targets on time .\r\n', 80, '2019-12-11 06:02:46'),
(176, 51, 887, 887, 19, 'My research skills have been highly improved .I had to do extensive research for this assignment thereby highly contributing to the group work. It has enabled me to know more in-depth information about  countries which  has added a great value to me .\r\nAlso, my  communication skills have been improved by giving feedback to my group members from my research by presenting during group meetings  .I always ensured areas assigned to me was tackled on time  highly participated so I always had information to tell the group from what I have researched on.\r\nMy leadership skills have been improved compared to last semester as in my group everyone had to take responsibility .I was very effective, and it increased my motivation level.\r\nFinally ,improved my  relationship with working with individuals irrespective of their culture. Team members roles  was clearly assigned, and which lead to a good working environment ,in future I will implement this method as it increases a better output of the final work.\r\n', 80, '2019-12-11 06:02:46'),
(177, 51, 887, 889, 19, 'Nawaf highly contributed to this assignment . He had a positive attitude  which helped the group and a good problem-solving skill .He was very honest which was a good way for preventing mistakes from turning out to be failure. He was vision oriented communicated very well ,cooperative and was very  supportive. He showed a great commitment to the group work and had a good problem-solving skill which was very impactful to the success of this assignment .Nawaf exhibited flexibility , direct and respectful which also prevented group conflict as we had a very focus and friendly working environment.', 80, '2019-12-11 06:02:46'),
(178, 50, 864, 851, 19, '10', 86, '2019-12-11 08:14:51'),
(179, 50, 864, 855, 19, '10', 86, '2019-12-11 08:14:51'),
(180, 50, 864, 856, 19, '10', 86, '2019-12-11 08:14:51'),
(181, 50, 864, 857, 19, '10', 86, '2019-12-11 08:14:51'),
(182, 50, 864, 864, 19, '10', 86, '2019-12-11 08:14:51'),
(183, 51, 864, 851, 19, 'Samantha is a silent group leader. She has a lot of in-depth knowledge of marketing and organisational behaviour and is therefore a key player when building the assignment structure. We tend to give her the conclusion part as she is great at bringing all parts together and the best person to react in case, we would need to adjust the presentation. Samantha also takes great pleasure in finalising the presentation and ensured the slides are coherent with Jessica. We must add, that her presentational style improved a lot, as she did not need to use notes this time and was fully confident in herself as well as the topic, she was presenting.', 86, '2019-12-11 08:14:51'),
(184, 51, 864, 855, 19, 'Ana is the master mind of theories behind our work. She will always turn around every stone in the research part, which could help us to the best possible results. She is truly an expert in theories and will share her findings with us. Ana is also very good in finding specifics in research that could enhance our work and give it the additional academic rigour. From working with Ana before, we must also add, that her presentation style improved immensely since the first time and one can tell that she enjoys sharing the knowledge and discussing the topic. Furthermore, she is the mother of the group; always prepared for any kind of situation as well as an endless source of support and advice about life.', 86, '2019-12-11 08:14:51'),
(185, 51, 864, 856, 19, 'A big part of the group’s cohesiveness is due to Claudia. She is a very empathetic person and reads the room quickly. Therefore, she is able to bring any emerging issues forward to discussion, as well as ensuring we always carry on in a constructive manner. Claudia will make sure, we do not forget the important part of enjoying the work, which always increased our creativity. She is also a key performer in the beginning, the time of brainstorming, gathering ideas and building the main core of the research. Claudia has a lot of experience in marketing as well as other field experience, which can be used in the academic environment. She is always a great presenter and takes her part very seriously and professionally.', 86, '2019-12-11 08:14:51'),
(186, 51, 864, 857, 19, 'Jessica is a very strong researcher and exemplary student. She is usually the first one in the group to be done with her part and then keeps improving and supporting everyone however possible. She is very determined and focused to get the task done and does not like to waste time. Therefore, she pushes the group to set deadlines and stay productive on all meetings. She is also very creative and did the final slides to make them coherent through the whole presentation. Furthermore, Jessica has improved her confidence in the presentations and getting the message across in a professional manner.', 86, '2019-12-11 08:14:51'),
(187, 51, 864, 864, 19, 'I could say that I am a very analytical person, who must write things down in order to see the bigger picture. Therefore, I could say, I am the coordinator of the group. I ensure, we have meeting minutes so everyone is on the same page and up-to-date. I tend to pay attention to details, that we might miss as a group and bring the emerging issues forward to improve our work. While this can be a good virtue, it can create a lot of additional stress, especially for myself. I have experienced this in the working environment in the past as well and am very grateful for the experience of working with these ladies. As a group, we aimed to understand and accept each other’s differences, utilised the best part of our characteristics and help each other grow. While doing so, we managed to find the right balance and have a good time as well.', 86, '2019-12-11 08:14:51'),
