(197, 51, 855, 851, 19, 'Through this assignment, we were able to leverage each other skills taking advantage of those natural talents. Samantha was another brilliant student and colleague, we were very lucky to have her on the team. She’s highly creative, diligent and attentive. Leadership comes very naturally to her. As a native speaker of English Samantha’s contributed hugely to our group with her assertiveness, making sure we were all navigating towards the same goals. Perhaps a suggestion for improvement is linked to the “bossiness” at times could be wrongly interpreted, however, she is very much aware of how different cultures have different interpretations about being demanding, of which she\'s never lost her sweet and caring nature. An absolute joy to work with would definitely do it again, and I would have no problem in recommending her for a job opportunity.', 86, '2019-12-11 13:15:50'),
(198, 51, 855, 855, 19, 'I have enjoyed a lot working on this assignment. It has broadened my knowledge of research as it has contributed to my development in managing people in a group setting, expanding my skills in understanding of the several theories on Leadership, National Cultures and Motivations more specifically, It has gave me opportunity to practice those learned skills, as if, I belonged to an organization where we need to evaluate our own behaviors and peers,  especially in the areas of time management, project management, managing conflict, ethics and relationships bringing very close to an organization’s environment. I believe I have achieved a positive outcome have taken this exceptional unit.', 86, '2019-12-11 13:15:50'),
(199, 51, 855, 856, 19, 'Claudia was very dedicated in researching, collecting information and relaying back by sharing materials for our assignment. I was particularly surprised by the amount of information she can attain and share by heart, only after listening or reading information once, which for someone that does not know her enough might have a wrong impression as she’s been conceited, however, she’s a very humble, hardworking and dedicated team member that I learned to appreciate and admire. Perhaps a small suggestion for improvement would be timekeeping however, it must be noted she was the only team member working full-time whilst taking the course. I would have no problems in working with Claudia under her leadership or recommending her for a job opportunity. ', 86, '2019-12-11 13:15:50'),
(200, 51, 855, 857, 19, 'Jessica has contributed a lot with our team through her fresh and intelligent ideas, also kind manners and sense of humor. Never afraid to take upon a challenge. Jessica has completed all the tasks self-allocated with commitment. Delivered on time, with good quality and accuracy. Perhaps a small suggestion for improvement would be around attention to detail skills, which I am sure in time she’ll be able to master it with competence. I would work again with Jessica, and I would not have any problem recommending her for a job opportunity. I believe being the youngest member of the group gave us the necessary insights into the new generation of students and professionals.', 86, '2019-12-11 13:15:50'),
(201, 51, 855, 864, 19, 'Marjeta was such a joy to work with, she is very unique and mature, brilliantly knowledgeable and with a very analytical mindset. Her attention to detail brought to our group the necessary skills of professionalism, project management and leadership any successful team must have. Marjeta’s contribution to the team was essential to keep the group cohesive and coherent; her critical mindset did not make her cruel to other members, quite the opposite it brought the best out of ourselves. Perhaps a room for improvement is to be mindful that not everyone functions at her level of detail orientation, just in order to avoid conflict of this nature. I would love to work with Marjeta again, and definitely under her leadership, also I would have no problem in recommending her for a job opportunity.', 86, '2019-12-11 13:15:50'),
