(220, 50, 835, 846, 19, '10', 84, '2019-12-11 14:15:56'),
(222, 51, 835, 812, 19, 'Chen is a hard-working person. He has a conserve personality. Most of his work has allocated information from me. Our group usually spent the time after the class to discuss about our assignment. I found that his work is decent. He took responsibility for analysis the American culture where Toyota has the second-largest market consumers. Most of his work has to cooperate with Patra which is related to Japan cultural as the comparison among two areas. Although, he has a well prepare for his presentation when the presentation time, he was a bit nervous and could not deliver the fluent speech as he used to prepared.  ', 84, '2019-12-11 14:15:56'),
(223, 51, 835, 835, 19, 'My work is about finding the Toyota Production System. My work is a bit different from other members that did Hofstede analysis. I spent a lot of time to do my research about Toyota and Toyota Kaizen which are both related to single loop and double loop learning theory. Unfortunately, the misunderstanding of mine that I have not put the theory in the slide. I need to apologies for the other members for the mistake that I did. I am the leader of the group who shares the idea of choosing a Toyota company because there are plenty of information that we can find. Most of the work I found from Harvard Business Review. Especially Kaizen theory and Toyota lean management.', 84, '2019-12-11 14:15:56'),
(224, 51, 835, 846, 19, 'Patra is a dedicated person for our group work. She is the secretary of the group. She is a minute taker. Her task is taking responsibility for the Cultural Difference in Toyota, especially in Japan. The work is decent. It was very elaborate. She took many ways to minimize her presentation within the time limit which is hard for her to accomplish. Due to her tasks was mainly about Toyota origin were based in Japan. Patra is the person who can accomplish hard work. She helps me and Chen to find information about Toyota. I am so proud of having her in our team.', 84, '2019-12-11 14:15:56'),
