(229, 50, 858, 863, 19, '8', 83, '2019-12-11 16:01:29'),
(230, 51, 858, 850, 19, 'She is good at English, so she helped the team correcting grammar and structures, and make our slides be more consistency. However, she often missed and always late for the meeting. This behave effect on the group’s communication and teamwork because sometimes she came late for one hour, and some of the group member cannot stay long. Therefore, we don’t have much time to look through our slides and practice for the presentation together. During the presentation, I cannot deny that she has done her job perfectly, and she helped the group to answer the questions as much as she can.', 83, '2019-12-11 16:01:29'),
(231, 51, 858, 858, 19, 'I’ve learned how to communicate with team members which we are different in nationality and culture. I have learned to manage team members’ time table, arrange the meeting to satisfy everyone. Dividing work with fairness according to each of members strengths and weaknesses, and make sure that everyone works equally. For the presentation, I would say that everyone tried to do in their best, but maybe we are lacking of practice as it was very hard to gather everyone together. We are not put all of our effort on it. I have learned that teamwork is one of the most important thing we should concerned, we cannot only responsible on your task, but we also need to help each other review and revise each other work carefully.', 83, '2019-12-11 16:01:29'),
(232, 51, 858, 859, 19, 'She is a quiet member in the group and she not gives opinions much, but when other members give her some suggestion about her part, she always accept and fix it. She has responsible for her assigned work, and turned up every time we had meeting. She did a good job on her slides, and she also did a good job during the presentation. She spoke clear and slower than other members. I see her effort to remember all the information and her effort to make the presentation become perfect. I admire her as a team member.', 83, '2019-12-11 16:01:29'),
(233, 51, 858, 860, 19, 'He is a little bit lazy and always late for the meeting. We have to call him every time, follow his work process, and ask him to make sure that he did some work. During the presentation, there are some points that he did not mention as he did in the rehearsal, and he was unable to answer the questions, but he can speak without notes in hand. He has done a very good job compare to his past presentation. However, I know that he done his best to make the presentation looks perfect, even his work quality is not that good. ', 83, '2019-12-11 16:01:29'),
(234, 51, 858, 863, 19, 'He has responsibility and done his part in time. He also tried to arranged the meeting and stimulated members to come for the meeting, and absolutely he is punctual. However, he is quite busy with his business, and when he faced problems he did not ask for help or told other members about the problems he could not solved. During the presentation, there are some points that he did not mention as he did in the rehearsal. However, I know that he put all of his effort to make the presentation looks perfect. I admire him as a team member.', 83, '2019-12-11 16:01:29'),
(235, 50, 806, 806, 19, '8', 85, '2019-12-11 16:35:46'),
(236, 50, 806, 824, 19, '8', 85, '2019-12-11 16:35:46'),
(237, 50, 806, 826, 19, '8', 85, '2019-12-11 16:35:46'),
(238, 50, 806, 836, 19, '8', 85, '2019-12-11 16:35:46'),
(239, 51, 806, 806, 19, 'I have worked significantly hard on this piece of assessment. For me personally I had improved my communication skills, especially listening and public speaking. I have become a more collaborative team player, especially since I had many poor group experiences which forced me to do most of the work alone, this time I was able to be less self-reliant and trust my teammates to deliver on their assigned tasks. I have gained a greater sense of confidence in presenting and public speaking, as my teammates were very supportive and encouraging. I better learnt how to apply theory to actual cases to get a better understanding on how companies operate. My principle role in the team was research, as I oversaw the coordination of the assignment’s layout and the theories to considered, for both national culture and organizational culture dimensions. I worked also on some aspects of design with Asma. My delivery on the day of the presentation, from feedback, was clear and easy to understand. ', 85, '2019-12-11 16:35:46'),
(240, 51, 806, 824, 19, 'Trang initially found a bit of challenge in gathering the information she needed, as some were not as clear as she had expected. Nonetheless, despite the limited information available she worked her best to endure she got all that was needed. She was not afraid to ask for help, which demonstrates maturity and humility in realizing one’s strengths and weaknesses and finding the best way to succeed. Trang was instrumental in the research on IKEA in China and the general understanding of the Chinese culture. Her understanding of Asia, particularly her homeland of Vietnam, helped her to accurately apply her personal experiences to illustrate Hofstede’s national culture dimensions.', 85, '2019-12-11 16:35:46'),
(241, 51, 806, 826, 19, 'Asma was a diligent worker, as the group proved to be overall. Her efforts were outstanding in the group, and she was the chief designer, ensuring that our presentation looked very presentable. There were many times when we met with difficulties and tried to determine a way forward, and her commentary and input proved very significant. She worked closely in finding examples for the application of Hofstede’s dimensions, as well as in understanding and documenting IKEA’s challenges in China. Even while presenting, despite the presence of nerves, Asma did well in ensuring that the examples she shared from her personal experiences, demonstrated her understanding of the concepts she examined. For these reasons I believe her work was well done.', 85, '2019-12-11 16:35:46'),
(242, 51, 806, 836, 19, 'Melvin served primarily as the group’s leader and was part of every decision making. Where there presented challenges, he quickly gave his useful insights and ensured that consensus was reached before we proceeded with the work. His contribution was focused on understanding the culture of IKEA, its leadership and ‘the IKEA way’. He also filled the voids wherever help was needed and ensure that everyone was getting through with their task in a timely manner and assisted where necessary. He delivered excellently during his presentation, and being from the Netherlands, he was well able to relate to his examples as he discussed the various dimensions of national culture. ', 85, '2019-12-11 16:35:46'),
(243, 50, 894, 882, 19, '7', 81, '2019-12-11 18:11:29'),
