(246, 50, 894, 894, 19, '8', 81, '2019-12-11 18:11:29'),
(247, 51, 894, 882, 19, 'Hamida is a lively energetic person every time coming up with new ideas and propositions for topic and companies to choose from in the beginning of the work, always spreading that positive energy and confidence in the team. Always committed to the team work by accomplishing her tasks and by responding present to meetings. She is always taking initiatives to search for the information and try to extract the most of it in an academic critical way. Further, she is active in the discussion group to let us know what information she found and if this would be beneficial for our case.', 81, '2019-12-11 18:11:29'),
(248, 51, 894, 885, 19, 'Osei is hardworking student who is always committed, someone who is doing what he is asked to do, he worked a lot on the theoretical part of the presentation did many researches to explain and make the link between theories and what we will need in our case study. It’s true that Osei is bit shy as a person but he was always generously efficient and a big help to the group in a way that his contributions were just exactly what our work need, did not need to ask him for changes or something and this saved us more time. He also, found some good literature resources he used for this part.', 81, '2019-12-11 18:11:29'),
(249, 51, 894, 888, 19, 'Olga is an easy person to work with to be honest, she is a charismatic leader with good sense of project management, always taking the initiative to setup our goals and make sure that we are going on the right path. She tries to proof read our work and give guidance on the overall flow of the work and tell where we need to orientate our researches more. Olgas’ comments were always accurate and helped our group work to be better in a way. She was participating in finding information’s and chose the suitable resources for our literature research and go in depth with the theoretical part linkage to the case study.', 81, '2019-12-11 18:11:29'),
(250, 51, 894, 894, 19, 'It’s kind of difficult to talk about myself but I think I was beneficial for the group in the areas I’m good at. With my colleagues help I did most of the work related to the case study. It was always my strong point to search for literature and make links in a critical way to decide which one is suitable for the case we were studying. Also, I think that this group work helped me and my group to understand how an academic presentation should be because to be honest I had a different vision of what we were supposed to do until we’ve got our tutor guidance and that is the reason why we are here doing a level 7 master degree to learn the right way to do thing and learn from each other’s approaches.', 81, '2019-12-11 18:11:29'),
