(268, 51, 851, 851, 19, 'Learning to communicate with others from different cultures. Time management and group presentation skills. \r\n•	Further developed my knowledge of Microsoft and the aspects of cross-cultural differences. Learnt how to deal with people effectively and commit to schedules and times. Being more confident in front of people to express my opinion and get my point across. Definitely improved my confidence and ability to take some authority in a group setting. Learnt to accept other opinions and ideas. I learnt to break complex tasks into parts and steps in order to complete each task effectively. Further improved my skills in planning and managing time. Furthermore, learning to refine my understanding of concepts through discussion and explanation. I improved my ability to give and receive feedback on my performance and work as well as challenge assumptions.\r\n', 86, '2019-12-12 05:06:05'),
(269, 51, 851, 855, 19, 'Ana I would express as the mother of our group, she is caring, kind and has such a big heart. Not only is she lovely to deal with as both a friend and team member but she is extremely hard working and dedicated to her studies, despite all her commitments to her home and children. She always shows up to the meetings prepared and ready to express her ideas and findings. She is always willing to go the extra mile putting her all into whatever she is doing. She is on time to meetings, present and engaged. I thoroughly enjoyed working with her on this assignment. Her commitment and drive to understand all the concepts of GLOBE was amazing. She was able to share her findings and understandings teaching us all something.   ', 86, '2019-12-12 05:06:05'),
(270, 51, 851, 856, 19, 'Claudia is such a strong and powerful woman with so much dedication and ability. She takes the stage by storm and is not shy to express her ideas or how she is feeling. With a full-time job and masters, she manages to complete everything on time and successfully, never letting her group down. I look up to the way she handles all the commitments she has in her life with such ease and perfection. At times, I feel she forgets how capable and special she actually is. Her work for the project was outstanding, expressing clearly the differences in culture between the two countries we analysed. Her speech in turn was wonderful and she was able to get her point across so smoothly and clearly. A great team member and friend!    ', 86, '2019-12-12 05:06:05'),
(271, 51, 851, 857, 19, 'Jess is the careful and quite gem of the group. Always present and engaged she gets her work done promptly and well. She is always eager to go the extra mile and add to making the assignment even better. Together her and I worked on putting together the final slides making sure they matched and had a creative edge. She is always present at the meetings and prepared with her work way before the scheduled times. Through this assignment we have become even closer as friends and I truly believe she is amazing person with so much potential for the future. Like everything, she gave this project 100% helping to make it the success it was.  ', 86, '2019-12-12 05:06:05'),
(272, 51, 851, 864, 19, 'Lastly but not least is Marjeta. This lady I must say is so impressive! She has so much drive and intelligence that no matter the task or environment she will achieve and thrive. Her studies and tasks are her priority, which is clearly demonstrated with how she gives it her all. Despite a cold she was present at the speech, delivering in turn an outstanding presentation. At each meeting she took charge of the minutes and was always checking up we were on the same page and in the right direction with regards to our research. I have so much respect for this amazing lady and would never want to do a project unless she was by my side. She held our group together like glue. Furthermore, her work on motivation was extremely insightful and complimentary to all the other research. She is a great group member and a friend I hope to have for life. ', 86, '2019-12-12 05:06:05'),
