(278, 51, 859, 850, 19, 'She is the leader of our team and inspired our ideas. She helped about the presentation and correct my grammar mistakes. Also, she managed the meeting all the time to provide everyone a concrete and direct presentation. Sundal compared the employee motivation between Chinese and US markets applied with Maslow’s Hierarchy theory. She did quite a lot research based on the facts, made hypothesis and elaborated clearly. I am glad to have such a team leader.', 83, '2019-12-12 06:17:26'),
(279, 51, 859, 858, 19, 'She is the teammate that helped about the ideas sometimes and always come to the meeting. She is always friendly and hardworking during the preparation. Vicky did a lot of research and explained several theories including Maslow’s Hierarchy, Herzberg’s two factor theory and Adam’s Equity Theory. She provided a great explanation on the theories so the other teammates can apply these theories to further present about the topic. I am glad to have such a teammate.', 83, '2019-12-12 06:17:26');
INSERT INTO `assess` (`id`, `question`, `from_user`, `to_user`, `project`, `value`, `grp_id`, `submitted_at`) VALUES
(280, 51, 859, 859, 19, 'I am the team member who always delivered the work on time and attended every meeting during the preparation.  I have researched a lot of facts and provided the overall background, history, salary, revenue, influence and how these factors make McDonald such a famous and successful fast food enterprise. I gave a precise and concrete introduction about the overall McDonald situation. Additionally, I prepared a lot at home to provide a well-organized part in the whole presentation have made plenty of suggestions on the topic and also keep updating the information. Overall, I think I have provided a well-done presentation.', 83, '2019-12-12 06:17:26'),
(281, 51, 859, 860, 19, 'Dylan sometimes was absent at the meetings but he also did a well presentation on that day. The PPT was also designed well to show a direct information to the audience. Meanwhile, Dylan also made hypothesis and explanations about power distance in terms of motivation. On that day, Dylan showed his confidence at the presentation and impressed me and my teammates. I am glad to have such a teammate.', 83, '2019-12-12 06:17:26'),
(282, 51, 859, 863, 19, 'Harry was the same as the others who is hardworking and show team efforts to delivered an overall well presentation. He also gave suggestions during the discussion of our topics and he was always the first to reach for every meeting. Though he has few words, he always delivered a good quality piece of work and show a good example to other teammates how a good PPT looks like.  On the day of the presentation, he encouraged me and made me feel confident just like him. I am glad to have such a teammate', 83, '2019-12-12 06:17:26'),
(283, 50, 884, 880, 19, '7', 79, '2019-12-12 06:31:25'),
(284, 50, 884, 884, 19, '6', 79, '2019-12-12 06:31:25'),
(285, 50, 884, 886, 19, '7', 79, '2019-12-12 06:31:25'),
(286, 50, 884, 891, 19, '6', 79, '2019-12-12 06:31:25'),
(287, 51, 884, 880, 19, 'She is the creator of ways to contact group work, such as gathering information that members can search for. In addition, she volunteered as a collector of all the information and then made it into a presentation and also allocate script for all of us. Although she seems quite busy with her work and cannot come to see us sometimes. But she does her part very well. Besides, she presented our project quite clear and fluently, so her performance on presentation was excellent.', 79, '2019-12-12 06:31:25'),
(288, 51, 884, 884, 19, 'In the beginning of our group work, I am quite enthusiastic at this group project. I come to meet group members on an appointment every time and on time. Due to I am kind of person that don\'t have much originality or creative thinking, so I support members\' opinions and give them a suggestion of our project. Besides, I try my best to find all the information that I was assigned to do by finding information on the internet and also consulting with professors.\r\n    However, for overall, I did my task quite well and also finished on time. And the presentation performance of mine was nice.\r\n', 79, '2019-12-12 06:31:25'),
(289, 51, 884, 886, 19, 'She is a person who is quite responsive to group work. She is the type of person with originality as this work started because she was the person who proposed us an interesting company “Marriott Hotel”. She is good at searching for information, not only in her own part but also others. She is the one who makes everything clear and makes the meeting summary after the appointment is over. \r\n       Besides, her performance on the presentation’s day was quite good.\r\n', 79, '2019-12-12 06:31:25'),
(290, 51, 884, 891, 19, 'She is a person who is very determined to work by attending the meeting and also giving suggestions to our project every time. Although sometimes she seems confused with what we are doing but she was able to do her part quite well by searching an important information for this project. And her performance on the presentation’s day was great.', 79, '2019-12-12 06:31:25'),
(291, 50, 813, 813, 19, '8', 87, '2019-12-12 07:44:35'),
