(295, 50, 813, 845, 19, '6', 87, '2019-12-12 07:44:35'),
(296, 51, 813, 813, 19, 'After finishing in group assignment, I have improved in my skills a lot such as speaking skill and listening skill. Because when we have meeting every weeks, we need to discuss in our work in order to share ideas, knowledge and information together. Therefore, I had to speak and listen with my team that lead to increase my skills and make me feel more confident when we have a presentation. Moreover, I have learned about collaboration in teamwork that helped us to achieve task faster than work in individual. So I think I feel satisfied and impressed in our group work because every member in our group tried to understand to each other without any conflict.  ', 87, '2019-12-12 07:44:35'),
(297, 51, 813, 816, 19, 'She knew hers responsibilities very well. When we had meeting she always arrived on time. Furthermore, she participated well when having group discussion. By doing this, she shared her ideas and research information to the members in the group. Every time when we allocated individual work, she always completed tasks on time. She is friendly and she is a good listener. With her sense of humor, we can work without stress. She not only worked for her own tasks but also helped other members to do some research in order to finish work earlier. Therefore, I think that she is one of good member in our team.', 87, '2019-12-12 07:44:35'),
(298, 51, 813, 819, 19, 'She seems to take a role as leader in our group. She is a person who delegated work to team member and set up due date for combining work before submission. Moreover, she is a kind of eager person who always follower up and remind team member to work actively. She also knew hers responsibilities well and would love to help group member by checking each individual tasks before submission. When we had question regarding our work, she was always the main person who communicate with teacher in order to clarify any doubts. Hence, I think she possess many skills that can contribute a lot to our group.', 87, '2019-12-12 07:44:35'),
(299, 51, 813, 825, 19, 'She is very punctual and responsible person. She can complete every task on time when we had meeting. Although she sometimes misunderstood the concept of work, she always put a lot of her effort to make things right. Plus, she is very helpful and friendly. When brainstorming, she is not only willing to share her opinions but also can accept other ideas. She is a kind of enthusiasm person who give a hand to help other members to lighten work load. Therefore, I believe that she is an effective team member who can lead our team to achieve task quickly.', 87, '2019-12-12 07:44:35'),
(300, 51, 813, 845, 19, 'He is quite responsible person but he sometimes did not respect the time. At the beginning, he misunderstood in his assigned work, which cause to rectifying work many times. He is sometimes lack of communication with team member. For example, he did not check message asking him to look at the research provided. However, he can get his jobs done on time before submission. Furthermore, he is a smart and well-rounded person as he can answer most of questions given by teacher after presentation. From my point of view, He is a good advice that can help our team to proceed in work easier.\r\n\r\n', 87, '2019-12-12 07:44:35'),
