(304, 50, 834, 847, 19, '6', 88, '2019-12-12 07:56:24'),
(305, 51, 834, 814, 19, 'Mohammed did a good job by doing what was expected of him to do. He did well by trying to communicate with group members. He at a point was out point in terms of what we wanted to do as a group but we most a time disagreed to agree. As a group we enjoyed working together and came to an agreement after many meetings where we had to make choices and how it was difficult to find information on our chosen companies and topics. At times his choice of words was a bit harsh and I personally corrected him on that and he was cooperative to admit and it kept on and i realize the cultural differences which we had to overcome as a group to give our work the needed attention to make sure we give it out best. ', 88, '2019-12-12 07:56:24'),
(306, 51, 834, 834, 19, 'I did my best in linking the logical flow of the work to mine part of the work. It was quite interesting to me and i loved my part. It gave me the a good understanding of our work and I did my best to come up with a conclusion which was about our findings and i contributed to all the other part of the work which i am happy to have done. I played a major part in building a team spirit of the work and also being positive about our work. I also believe i lifted up the team spirit of other members of the group and i was really happy we were able to overcome the fear of presentation. ', 88, '2019-12-12 07:56:24'),
(307, 51, 834, 841, 19, 'Adriano was amazing in terms of the work and he did his part very well which i had to continue from his part directly. We met often to ensure that he introduced my part well into the work and he did justice to it. He was really cooperative and he exhibit a good team work attitude. He showed genuine concern and i love that part of him. We shared information together and ensured that our was not general but focused on our theme which we did our best and came out to be successful. Adriano is creative and flexible thinker. He takes the least opportunity to make the best of that opportunity. He shared ideas and he like to make fun many times we meet as a group which took away some tension. He did well and i enjoyed his contribution as any other member as well.', 88, '2019-12-12 07:56:24'),
(308, 51, 834, 847, 19, 'Rosie was incredible and most often appeared to be much concerned not just equally as everyone but at times she overly cared about the work. She came to meetings on time and contributed very well on her part. I actually liked her part very well and Mohammed introduced her amazing well to do justice to her part which she also brilliantly introduced Adriano which I did the needful to the work to make a logical flow for any one who took our work to understand our work which at a point we were talking about the leadership style instead of organizational culture which we linked and made real meaning when it comes to organizational culture. I believe Rosie did really well.', 88, '2019-12-12 07:56:24'),
