(313, 50, 857, 864, 19, '10', 86, '2019-12-12 10:32:15'),
(314, 51, 857, 851, 19, 'She is as young as I am and yet I had a lot to learn from her; she is a strong, capable, enthusiastic and passionate woman. She helped us all with the English and that gave a big impetus for the presentation. She had a lot of advice to make our work better, as she is also the only one with a marketing background. Working with Samantha was engaging and very interesting, she was always very positive and well-prepared during the meetings and she gave her best in delivering the presentation. We worked together to make the slides matching and creative.', 86, '2019-12-12 10:32:15'),
(315, 51, 857, 855, 19, 'Ana has been a pillar for our group, she has challenged the group with many questions, giving us knowledge and support throughout all year of this master. She put a lot of effort in this group presentation, she has made a lot of research, nonetheless, she gave the opportunity to the group to learn more about the topic (GLOBE) and we all felt the passion she had for it. It has been a great pleasure working with her, discussing with her was always constructive and positive, giving new hints for me to look at. She was always coming to the meeting in time, well-prepared and positive.  Ana is an inspiring woman, kind, and powerful. ', 86, '2019-12-12 10:32:15'),
(316, 51, 857, 856, 19, 'Since the beginning Claudia was very engaged with the topic, she was the one how was working a lot during this semester and it has been hard for her to fit together work and university, but she did it and very well. She came always to the meetings; she was prepared, and she explained her topic during the presentation in an excellent way; Claudia expressed the cultural differences between the USA and Japan amazingly. I found it very engaging. She taught the group patience and respect for others’ schedule, I found her a hard-working, strong and beautiful person, and it was amazing working with her.', 86, '2019-12-12 10:32:15'),
(317, 51, 857, 857, 19, 'I find hard to judge myself; mostly because I always feel that I could do more or better: this time I am confident that I gave 100% for this group assignment. I tried to be always positive and engaged with everything the group was going through. I have worked hard for the presentation, as the others, and we were very happy about the result. I found interesting researching the company information online, it has been a challenge, but looking back was very engaging and helped me a lot to understand how good companies work. Therefore, I loved working on the creative part of the presentation working on the slides. ', 86, '2019-12-12 10:32:15'),
(318, 51, 857, 864, 19, 'Marjeta was the glue that kept the group together, she was the one pushing us to achieve more for this presentation: it was very hard at the beginning to figure out what the assignment ask us to do and how, she was the one challenge the decision we made and the method we were using. Marjeta was always coming to the meetings, expressing her doubt and concerns to us and she has been always positive and committed to achieve more and do better. Her work in expressing the motivational theory was outstanding and very detailed. I believe she is a strong, capable and valuable lady that did a great job for this presentation. ', 86, '2019-12-12 10:32:15'),
