(328, 51, 883, 881, 19, ' Attended a lot of meetings or gave reasonable warning if he was unable to. Was however unable to attend meetings when we were getting close to the deadline, which made it hard to compare work and ensure everything was tied together. Did work quickly and showed proof of this. Quality of work was good, though I feel some areas may have been misunderstood. I believe he has worked hard in terms of his own capabilities. He did show a lack of interest on the day of the presentation, spending most of the time on his phone while the rest of us were practising presenting for him. ', 80, '2019-12-12 14:32:12'),
(329, 51, 883, 883, 19, 'Attended most meetings or gave reasonable warning if I was unable to. Communicated clearly with team members in person and over WhatsApp, though I feel I had trouble understanding the team, which was clearly frustrating to them. Completed work within agreed times and showed proof of this by posting all notes in the public presentation file. Quality and understanding of work was good, but could be tied together better with the other theories. ', 80, '2019-12-12 14:32:12'),
(330, 51, 883, 887, 19, 'Attended all meetings. Did work quickly and showed proof of this. Quality and understanding of work was very good. She was however quite negative towards this assignment from the start, and would regularly make comments about how we needed to finish it so we could just be done with it. It could be hard to have discussions with her due to a language barrier, but she had no problem voicing her opinion. I believe she did great work, but lacked some enthusiasm - however she made up for this by being a great teammate.', 80, '2019-12-12 14:32:12'),
(331, 51, 883, 889, 19, 'Did not attend the first weeks of classes, and missed our first meetings or was severely late with no warnings. After a serious talk it did get better. Did not do work at agreed times (he claimed to, but had no proof of this), and the quality of his work was mediocre. We did not see or hear any of his work until the day of the presentation, which made it hard to incorporate it into our work. Despite the team asking him to change his slides numerous times, he refused to do this and we tweaked them for him in the end - he even had the incorrect flag for the UK! All team members were asked multiple times at the end if all references had been added, which he replied to saying he had added his - this was also not the case. I had even personally added a few of his references for him at that point. We did our best at guiding him, but language barriers and lack of his own work resulted in mediocre work at best, far from university-level.', 80, '2019-12-12 14:32:12'),
