(337, 51, 819, 813, 19, 'His part is long-term orientation.\r\n\r\nHe is active to work and can get the work done very fast. He worked hard to get his part done. His responsibility is high. He is always punctual when we had meetings. He always texts back when we discussed online in group. His critical thinking skill was really good. His work was neat and could be easily understood. When we practiced the group presentation, he helped us to estimate the time and changed the slides.', 87, '2019-12-12 14:41:26'),
(338, 51, 819, 816, 19, 'Her part is introduction (theory and aim), uncertainty avoidance which is more than others part. \r\n\r\nWorking with she was very nice. First, she was well-organised, which was useful for working with team. She could find the way of how to divide the work easily. Next, she was enthusiastic to work. Her work was neat and easy to understand. Her responsibility was high because she could get the work done in time. She was a calm person and happy to explain everything about the work to other members\r\n\r\nWhen we had meeting in face-to-face, she was always punctual. When we communicated online, she always responded to our massages.', 87, '2019-12-12 14:41:26'),
(339, 51, 819, 819, 19, 'I have improved my managing skills. When working with team, I have learnt about how to deal with people. My team members are from different countries and sometimes it is hard to communicate and understand each other. It also makes me know my weakness from working in this subject. I found out that I am hot-tempered person because when I had to explain things many times I felt like I was a bit angry. So, I am trying to improve this area.\r\n\r\nI also had to be very responsible because I was the person who combined the work, checked everything, and did the presentation slides.', 87, '2019-12-12 14:41:26'),
(340, 51, 819, 825, 19, 'Her part was power distance.\r\n\r\nShe was always happy to help us carrying the group work. When we had meeting, she came every time and she was also punctual. When we explained her about the area of the work that she did not understand or unsure, she could understand it easily. She could get the work done although sometimes it was not in time but she told us before so that made us feel okay.\r\n\r\nShe always responds to our massages when we communicated online.', 87, '2019-12-12 14:41:26'),
(341, 51, 819, 845, 19, 'His part is masculinity and indulgence.\r\n\r\nHe was smart but his responsibility was a bit low when compared to other. He could not get the work done in time and that made us had to postpone the deadline of our group work many times. \r\n\r\nWhen we had online discussion, he was barely reply to the group and that made the group members did not know if he agreed or disagreed or he could understand what his tasks was or not. Although we had explained and showed our works for him as examples but he did not pay much attention to them and that made he did the wrong works. His work was not neat and hard to read.\r\n\r\nHowever, he was a nice person and could answer the questions when we had a presentation very well.', 87, '2019-12-12 14:41:26'),
