(347, 51, 853, 853, 19, 'I have learnt many things from this assignment. It’s not only the knowledge about this unit, but also how to deal with people in specific situation. As we had a different background, so we need to adapt and understand each other to achieve our goal together. I was happy that I had the opportunity to work with them, even though sometimes we had some arguments with some members in the group. In term of my responsibility, I put a lot of effort for this assignment. I tried to share ideas and help other members as much as I could. I worked very hard for creating a good quality of work. For the presentation, I known that my English was not that good, but I tried my best to present it without a script. I practiced a lot and I was satisfied and impressive with the result.', 89, '2019-12-12 14:42:32'),
(348, 51, 853, 854, 19, 'I was very satisfied with both his work quality and his contribution to the group. He was a very good member. He always proposed his amazing ideas and he always made me feel surprised with his ideas. He was a very supportive person. Moreover, he was not only do his work, but he also helped other members do their part. I was very happy to work with him. I have learnt many things from him. He also helped me when I have problems or questions about my task. Importantly, his work was very well-prepared with good quality. Also, his presentation was very impressive. Although English was not his mother language, but he could explain his presentation very well with high confident. ', 89, '2019-12-12 14:42:32'),
(349, 51, 853, 861, 19, 'I was very happy to work with her. She was a good team member. She was very good at generating new ideas. She also was a good listener. She always listened to other member opinions and gave her comments to improve and develop our work. She always shared her knowledge and experiences which were very useful for our work. Moreover, she was very kind and helpful. She was not only focus on her work, but also, she tried to help other members. I was satisfied with her work and presentation. Her work was very impressive with high standard. I felt that she highly contributed to the group. ', 89, '2019-12-12 14:42:32'),
(350, 51, 853, 862, 19, 'She was a good member. It was a good opportunity to work with her. Even though sometimes she didn’t have knowledge about some topics that other members talked about, but she showed her effort to contribute with the team. However, she should have more confident. Many times, her ideas were very interesting, but she rarely expressed her ideas or opinion that much. However, it was not a big problem. One thing that she made me feel impressive was she has never missed our meeting even once and she has never been late. It showed that she had high effort and contribution to our group. I was satisfied with her work. It was not that outstanding work, but she showed her effort on it. Importantly, her presentation was very good. It was better than I expected. I was happy to work with her.', 89, '2019-12-12 14:42:32'),
(351, 51, 853, 865, 19, 'He contributed a little less than most other members of the team. He was not that bad member, but I would like to suggest that in the future if he has the opportunity to work with others, he should develop himself in some ways. This assignment was a group work not individual work, so teamwork was very important, and his ideas was also important. He rarely came to the class, so it was difficult to have a meeting together with him. He was a good listener, but he should share more his ideas or opinions. Importantly, I was not impressive with his work; I had to adjust the contents many times. For the presentation, he should practice more and tried not to use a script. I don’t mind when working with teammates who is not good at that area if they show willingness and efforts.', 89, '2019-12-12 14:42:32'),
