(356, 50, 854, 865, 19, '4', 89, '2019-12-12 14:47:46'),
(357, 51, 854, 853, 19, 'She is very good team member. She tried to help and shows very high participation and efforts. She supports her group mate very well. She works hardly for every part whether it is her responsibility or not. She always shows high contribution and ideas. Her overall work is impressive and very informative. To conclude, she is a very good team members that drive the team’s performance. Her presentation is impressive and well-prepared. You will always see her noting and summarising all the task everyone needs to do. Which, she will be very promising if she has more confidence in herself.', 89, '2019-12-12 14:47:46'),
(358, 51, 854, 854, 19, 'I have learnt many things from this project. I learnt how the important the work allocation is. However, it is difficult to work with people with different perspective and cultures. I realise sometime people are not the same, but we need to cope with the specific problem that emerge all the time. Plans should be flexible so as the perspective of our own. Nevertheless, regardless of how much one devotes to his/her work, the result may differ. We cannot expect everyone to work as hard as we do, but we should not let their lack of effort affect our willingness to accomplish the task. Try best is the must to succeed and I will still believe that hard work will pay off for every hard-working people.', 89, '2019-12-12 14:47:46'),
(359, 51, 854, 861, 19, 'She always proposes an interesting idea and help group member when everyone is struggling. Her work is interesting and well-done. She contributed a good effort and participation. As a result, she is an important people that support the project. She is very supportive when team members are struggled. She gave a hand to help others. She is a very good listener as well as idea generator. She leads the team forward while support others at the same time. It is good to work in a good environment with skilled people. I learn to absorb the perspective of people in different culture and it is a good experience to work with.', 89, '2019-12-12 14:47:46'),
(360, 51, 854, 862, 19, 'She is a very good team member as she shows high participation all the time. She shows effort even though she was struggled with something. She lacks self-confidence so she does not contribute a lot in ideas. However, she is very supportive, and try hard to perform the best performance for the group. Her presentation is beyond expectation. She is a good listener which is a good point of her. She shows impressive development in her work and I like the way she manages her time. It is good to learn from different culture and I enjoy working with her. ', 89, '2019-12-12 14:47:46'),
(361, 51, 854, 865, 19, 'He lacks participation and effort. Also, his work has very low quality and need everyone to help him in his work. He is always absent in the meeting. His work is very unrelated to everyone, so it affected overall work quality. He lacks willingness to make everything good. It is like everyone needs to control him unless he will do nothing. He denies to help others in work. Finally, his presentation performance is very bad. He read the script though the group members told him not to, plus, it is very terrible that he does not practice his presentation. He disappoints all the group members in everything. However, he is not a stubborn person even though he shows too much laziness. It would be great if he can be more energetic and hard working.', 89, '2019-12-12 14:47:46'),
