(370, 51, 802, 802, 19, '-Unfortunately in that period my father passed away so I had to go back to my country to attend the funeral, hence I\'ve missed three weeks worth of meetings. And some of my colleagues has showed great support to me while I was away. And once I came back I was involved just like everyone else and I contributed to the group work. And when one of the group members went away for holidays I was the one responsible for finalising the work, and it was challenging because of the other work that we were doing in that period. However, we were able to finish it on time and present that great work. ', 82, '2019-12-12 15:45:18'),
(371, 51, 802, 839, 19, '\r\n-My colleague was always on time even though he was working but he showed a great amount of commitment, he is a great team member and it was really easy to work with him. During the work, he was responsible for the technical side of the work and he has done a great job in terms of putting everything together and putting it on the slides. Further, he has done well searching for materials and summarizing so we can use it in the presentation. \r\n', 82, '2019-12-12 15:45:18'),
(372, 51, 802, 843, 19, '-First I would like to thank this group member for showing me a lot of support while I was away. She was always keeping in touch with me and keeping me updated, also she was responsible for organizing the work even after one group member left we were able to work on it, and my colleague showed a great amount of commitment and she worked hard after that group member left to cover her absent. She was a little bit late for meetings but when she shows up she was always doing well and present results for the rest of the group members. ', 82, '2019-12-12 15:45:18'),
(373, 51, 802, 844, 19, 'With this specific group member, it was a little bit challenging to work with him as he did not get along with the group member that she left, and we were always having issues communicating with him. And even after our colleague left it was still difficult to deal with him as he did not understand that we are working together and not in different teams, he was always complaining even when I left for the funeral he did not show any empathy and he was always focusing on our mistakes rather than communicating and rectify those mistakes. However, he was always on time and he did attend all of our meetings. and at the end, we were able to finish the work and present on time that great peace of work. ', 82, '2019-12-12 15:45:18'),
