(378, 50, 825, 845, 19, '5', 87, '2019-12-12 16:11:33'),
(379, 51, 825, 813, 19, 'In this teamwork, Khom is kindly in helping me and other members. He arrived on time at each meeting and was very group oriented. He concerned about each of our members, and often asks everyone about their work progress then makes suggestions to us. In addition, he is a humble person who can listen to everyone\'s opinions and face the difficulties and problems, he treats the assignment with a positive attitude. When preparing for presentation, he actively practiced with teammates. Therefore, when we formal presentation, he performed very well, expressed fluently and had clear ideas, leaving a good impression for the tutor.', 87, '2019-12-12 16:11:33'),
(380, 51, 825, 816, 19, 'Hang is a thoughtful girl, she has a lot of ideas, and take assignment with both speed and quality. She has a clear mind and an orderly manner. In the group preparing of presentation, she provided many useful materials and documents for everyone. Furthermore, she printed materials for everyone to make each member more convenient in the group work, which is very helpful to our team. In addition, she made a lot of contributions in the production of power point and put in a lot of time and energy. Help every member of the group patiently, never complaining, the success of the group\'s presentation is inseparable from her.', 87, '2019-12-12 16:11:33'),
(381, 51, 825, 819, 19, 'Kaow is passionate and takes good care of teammates. In the teamwork, she played the role of leader and divided tasks to everyone in each meeting. She carefully checked the documents for everyone and found out the shortcomings directly. More importantly, she insisted on participating in group meetings when she had a fever, and she was never late and absence. The group time plan is made by her so that everyone has enough preparation time. When a member does not complete the group task on time, she kindly helps the person and solves the problem. She strongly expressed her opinion in presentation and won the affirmation of tutor.', 87, '2019-12-12 16:11:33'),
(382, 51, 825, 825, 19, 'In this group work, I feel the importance of teamwork is the need for the efforts and support of each team member to achieve this presentation success. During this experience, I also found many shortcomings of myself. For example, in discussions with other team members, I\'m not good at to provide objections to other group members and I have a hard for me sticking to my ideas. This is actually a big problem. Because it is possible that I have put forward my opinion, which could bring different help to our group work. In the presentation, my start points gave our group a good beginning and at the same time strengthened everyone\'s confidence.', 87, '2019-12-12 16:11:33'),
(383, 51, 825, 845, 19, 'Prem is an introvert and is not good at expressing his opinions and ideas during group discussions. But he is very friendly to each group member. Sometimes late in group meetings. When he encounters a problem in the group, he will actively ask the opinions of other group members and rarely make his own decision. In addition, when the other group members had a heated discussion, he always listened patiently and never interrupted others\' thinking. In the presentation he tries his best to strive for the success of our group and he could answer the questions asked to come from the tutor.', 87, '2019-12-12 16:11:33'),
