(387, 50, 824, 836, 19, '7', 85, '2019-12-12 16:30:09'),
(388, 51, 824, 806, 19, 'Rodwell is quite good at his academic research skills. He worked for theories which had been used in the presentation. In my individual view, he did the most important part which is about the theories. These theories had been used and improved in upper level. He also used a wide range of academic reports, journals and other resources in his part. He has good capacities in team working as well. Whenever the team had different opinions in one or some issues, he always looked at various sides of problems. He wills to help team member whenever they need.  ', 85, '2019-12-12 16:30:09'),
(389, 51, 824, 824, 19, 'I worked for the Chinese culture and every problem, challenges which Ikea faced in China. Also giving experience based on the theories which had been given in the Definition. With this way of work, our team guaranteed that each members needed to understand whole contents that given in the slides. I need to highly careful with every information in slides, especially about Chinese cultures because there are many characteristics of Chinese but we only need things which is related to Human and Human resource management. It is hard part because sometimes it made people confused. We are all from the different part of the world. I also learnt about the different culture and religions among us. During the group meetings, I learnt how to work with people, how to give comments with the way people will happy to receive. I was so happy when working with my whole team. All of them are hard-working, respectful and friendly, willing to help each other. ', 85, '2019-12-12 16:30:09'),
(390, 51, 824, 826, 19, 'Asma had contributed a lot for the content of the presentation. She worked on every example that had been given in the slides. The examples we expected that must have various backgrounds, countries, interesting and from academic resources. She also worked for the theme of the presentation. She did well for the design and structures of slides with creative imagines that showed contents without saying too many words. To do so, she must understand the content to do it as effectively as possible. She was good at presentation as well. She is a supportive member that every group need. ', 85, '2019-12-12 16:30:09'),
(391, 51, 824, 836, 19, 'Mel is good at leadership. Mel worked for the history and the vision of the company. He might not too well in research and finding academic resources. However, he worked well in the team. He kept the team on the right track. He was likely a secretary in my team. He reminded people to do their work, wrote notifications to make sure members in my team all understand what we need to do. Because of him, we are all in time and positively control through whole progress. Me and Mel had a various discussion while we were working together. In these situations, he showed his respect to other’s opinion even sometimes, we were no in the same side. He also is a good cheerleader. He is fun and makes the team working so much easier and funnier', 85, '2019-12-12 16:30:09'),
(392, 50, 839, 802, 19, '6', 82, '2019-12-12 16:41:15'),
(393, 50, 839, 839, 19, '6', 82, '2019-12-12 16:41:15'),
(394, 50, 839, 843, 19, '7', 82, '2019-12-12 16:41:15'),
(395, 50, 839, 844, 19, '6', 82, '2019-12-12 16:41:15'),
(396, 51, 839, 802, 19, 'Because of team reformation, he comes to our team later, but he performs good research skills. In addition, he is hard-working, he is good at collecting the information as well as summarizing document. Although, he experiences sadness in his family, he still tries to join most of meetings. Especially, in presentation day, most of questions is answered by him because of his working experience in the past at multi-national companies. In the working process, if we have any tasks that have not been done, he frequently covers and give recommendations to improve the task quality.\r\n', 82, '2019-12-12 16:41:15'),
(397, 51, 839, 839, 19, 'In this group work, I am in charge of describe the difference in cultures of two countries that companies operating in. Thus, the theory of Hofstede cultural dimensions is my main task that illustrate a overview of cultural background of the United Kingdom and India. Through this theory, the members who are responsible for motivation parts have the chance to develop their work. After whole content put in the slide, I have the mission to convert to the brief slide with the aim to make sure all audience are able to understand clearly about our content. ', 82, '2019-12-12 16:41:15'),
(398, 51, 839, 843, 19, 'She is our team leader who raises the content structure, the idea of company we working on. Furthermore, she has a various knowledge about general theories such as: cultural dimensions and motivational theories. Then, she is responsible for the application of Adam’s Equity for Kellogg’s that emphasizes the differences in employee’s treatment inside the organization. It seems to be that she plays a critical role in our group that builds cohesive connection among team members. In contrast, in some meetings, she comes a bit later than the others which makes the working process is postponed few minutes.', 82, '2019-12-12 16:41:15'),
(399, 51, 839, 844, 19, 'By the experience in being lecturer, he has a variety of theoretical knowledge that is appropriate to our report. At the same time, he has academic views of issues, so he usually give us advices to enhance the diversity of works. In addition, living in various countries gives the favourable condition to him to widespread views of different cultures including: developing and developed countries. Also, he is a diligent person who takes care of tiny details of the report. For instance, we sometimes put the information without references, he will supplement them to the report.', 82, '2019-12-12 16:41:15'),
(401, 50, 812, 812, 19, '6', 84, '2019-12-12 16:52:55'),
(402, 50, 812, 835, 19, '6', 84, '2019-12-12 16:52:55'),
(403, 50, 812, 846, 19, '6', 84, '2019-12-12 16:52:55'),
(405, 51, 812, 812, 19, 'My responsibility is comparing the culture different between Japan and America plants. Also, give an example of how can the company solve the issue while they meet the culture different. I would like to listen to the other members\' idea first and give my opinion later. While I find the external information, I also like to share in the group and ask the other groupmates idea. When I got my task, I devoted myself to finish my work and discuss with the members. Although, we finished our draft early and received the feedback from the teacher. In general, we still not doing well on the work. Because we didn\'t deeper understand and analyse the theory. Thus, now we know that we have to underline the theory through a case study.', 84, '2019-12-12 16:52:55'),
(406, 51, 812, 835, 19, 'Pichan responsibility is doing the introduction and conclusion. However, Pichan introduced briefly about various Toyota working system and philosophy in the world and how can Toyota adapt the company working system to the employee. Also, sum up the philosophy is an essential concept that Toyota wants an employee to learn. Pichan is a reliable person too. He good at find and collect the information. Then share all of the relevant information to the group member. He also has a lot of idea about the works and dedicates himself to the assignment. In the final, he has a good performance during the presentation.', 84, '2019-12-12 16:52:55'),
(407, 51, 812, 846, 19, 'Patra responsibility is doing the Japanese working culture, analyse Japan personal preferences, and the mindset of the Toyota company. She is a reliable person who can finish her work on time before the meeting also has good communication with the team. When the group have met the problem with the work, she always the first one going to find the information. Sometimes when I doubt about my work, she willing to give the suggestion and taught me how to connect with her work. Finally, she finished her work and delivered a good performance. Besides, she has a good present during the presentation.', 84, '2019-12-12 16:52:55'),
(408, 50, 814, 814, 19, '6', 88, '2019-12-12 17:02:23'),
(409, 50, 814, 834, 19, '6', 88, '2019-12-12 17:02:23'),
(410, 50, 814, 841, 19, '6', 88, '2019-12-12 17:02:23'),
(411, 50, 814, 847, 19, '6', 88, '2019-12-12 17:02:23'),
(412, 51, 814, 814, 19, 'From the beginning of working on the assignment, I worked hard in choosing the company and the topic by reviewing every single topic carefully and applying them to multinational companies until we agreed on Ford. I also acted as a facilitator and coordinator among the group members to break the ice among the group and tackle any issue we might encounter. I exerted a lot of effort to find the most relevant information for our case study, then I discussed this information with my peers. I was totally open to hearing their feedback regarding my work and change my approach if their feedback was meaningful.', 88, '2019-12-12 17:02:23'),
(413, 51, 814, 834, 19, 'Gideon worked hard to achieve the highest grade; He has some good ideas in terms of the analysis and comparing theories. His overall work was good and fruitful and his research outcomes were very effective. From my collaboration with Gideon, I think the main problem that he has is communication skills. He must work more on his communication skills to be able to deliver his ideas clearly to the listener to avoid any confusion and misunderstanding to him\\her. He also sometimes appeared to focus on trivial matters rather than the core ones. He should differentiate between the core tasks and the secondary tasks and put the furthest behind the first.', 88, '2019-12-12 17:02:23'),
(414, 51, 814, 841, 19, 'Adriano’s contribution to the group was obvious; He cooperated consistently with the entire group member and offered constructive suggestions to peers to enhance their work. He was listening attentively to the responses of the other group members and was always asking questions to clarify the vague points. He worked hard to find relevant information regarding our case study and was always discussing his research outcomes wit us. He must work more on his IT skills (especially PowerPoint) to be able to turn his ideas into an effective and engaging presentation. He needs to improve his time management skills as he sometimes appeared to be the man of the last minute.', 88, '2019-12-12 17:02:23'),
(415, 51, 814, 847, 19, 'Rosy participated well in all of the meetings. She was punctual, she encouraged the other group members to work hard, and she was always taking the initiative in terms of research and finding. She worked hard to find a suitable company and a topic, but her research outcomes were always irrelevant. At the beginning of our research, she chose a very difficult company to find information about. The resources she shared regarding the case study have nothing to do with the company and the topic. She needs to read the requirements of the assignment carefully and understand it well before she starts study and search.', 88, '2019-12-12 17:02:23'),
(416, 50, 836, 806, 19, '6', 85, '2019-12-12 17:22:45'),
(417, 50, 836, 824, 19, '6', 85, '2019-12-12 17:22:45'),
(418, 50, 836, 826, 19, '6', 85, '2019-12-12 17:22:45'),
(419, 50, 836, 836, 19, '6', 85, '2019-12-12 17:22:45'),
(420, 51, 836, 806, 19, 'Rodwell is a nice person to have in your team. He is really skilled and has a lot of knowledge. He is interested in understanding theories and explaining them to other members in the team. This helped us to take our presentation to a next level and to make sure that the whole team understood everything we wanted to discuss in the presentation. Because he was interested and well skilled in doing the research he helped all the team members with finding the right information. Furthermore Rodwell was a pleasant person to cooperate with. He made every deadline and during meetings he was on time. A good addition for a team.  ', 85, '2019-12-12 17:22:45'),
(421, 51, 836, 824, 19, 'Trang is a really nice and kind person. She is always coming to meetings with a big smile and has a lot of positive energy. This energy she is also trying to give to all the other members of the team. Besides that she is also really good in saying the right things at the right time. If we were debating about a subject Trang could make a difference with her opinion. Her thoughts about some of the subjects could be from a different angle what made it possible for the team to get to new ideas. Furthermore she was adding value with her asian background. This helped us a lot with the subject we were working on. She could relate to the asian culture and knew how to explain this to us. In that way we could better describe some subjects in the presentation. I was glad that Trang was in my team.', 85, '2019-12-12 17:22:45'),
(422, 51, 836, 826, 19, 'Asma is a real addition to a team. Her visual view on creating a presentation is adding value for a team. Together with the team we created the content for the presentation, but she took the presentation visually to a next level, because she knows how to change the visuals in a clear and clean way. Furthermore she was contributing a lot in the discussions which we had about several subjects within the presentation. She came up with new ideas and she tried to inform other members if she found good information. I worked together with Asma in other project, but it is always pleasure to work with Asma.', 85, '2019-12-12 17:22:45');
INSERT INTO `assess` (`id`, `question`, `from_user`, `to_user`, `project`, `value`, `grp_id`, `submitted_at`) VALUES
(423, 51, 836, 836, 19, 'During the teamwork for the presentation, we can say that overall it was a good team performance and that everyone contributed to this performance. If I look to myself, then I can say that I was arranging all the meeting and deadlines. I really tried to make sure that we were on track of delivering a good piece of work on time. Besides that I was also trying to challenge every member about their content. This to create the best content for the presentation that was possible. In the future I need to except that there are differences between countries. I realised that sometimes I was having expectations that were suited for the Dutch culture. In the future I need to adjust the expectations.', 85, '2019-12-12 17:22:45'),
(424, 50, 863, 850, 19, '6', 83, '2019-12-12 17:38:05'),
(425, 50, 863, 858, 19, '6', 83, '2019-12-12 17:38:05'),
(426, 50, 863, 859, 19, '5', 83, '2019-12-12 17:38:05'),
