(428, 50, 863, 863, 19, '7', 83, '2019-12-12 17:38:05'),
(429, 51, 863, 850, 19, 'Sundal is a very intelligent person. She knows how to deal with the problem which our group is facing. She is also very good at presenting in front of people and she taught everybody in the group how to do that, how to use simple words to explain your ideas in the presentation. She often comes up with many creative ideas that are very helpful in the presentation. Despite she did not come to lectures or seminars, she still managed to attend almost of our group meeting. ', 83, '2019-12-12 17:38:05'),
(430, 51, 863, 858, 19, 'She is a very hardworking person. She is in charge of giving knowledge of the theory that we use. She managed to finish her part on time for the meeting. She does her job quite good. She has a variety of theoretical knowledge that is appropriate to our presentation.', 83, '2019-12-12 17:38:05'),
(431, 51, 863, 859, 19, 'She is in charge of giving the information about the culture in McDonalds company in the US and China. Although at first she has some misleading about her part but she managed to correct it on time. In some meetings, he comes a bit later than the others which makes the working process is postponed few minutes.', 83, '2019-12-12 17:38:05'),
(432, 51, 863, 860, 19, 'He does his job quite good but he rarely comes to lectures and seminars so that we are lacking of having a connection between team members, he did not attend a few meetings as well. But after all  he did a quite good job, he managed to present his part very well but I think that if he put more effort in to the work, he would have done it better. In contrast, in some meetings, he comes a bit later than the others which makes the working process is postponed few minutes.', 83, '2019-12-12 17:38:05'),
(433, 51, 863, 863, 19, 'In this group work, I am in charge of describing the long term orientation dimension and put every body\'s work together with Sundal. I manage to attend the seminar and the lectures but some of the seminar lesson there are only me as the members of group 3 so that it is quite difficult for me to ask team member\'s ideas in the seminar. I also find it quite difficult to find academic references to support my case study.', 83, '2019-12-12 17:38:05'),
