(443, 50, 861, 862, 19, '8', 89, '2019-12-12 18:37:05'),
(444, 50, 861, 865, 19, '4', 89, '2019-12-12 18:37:05'),
(445, 51, 861, 853, 19, 'Nanticha Cheewalertpanya was very active throughout the research process and during the presentation. He is a very important member of our team. She did not hesitate to give her opinion and help other members if necessary. Its advantage was to check the structure of the PowerPoint, spelling mistakes but also references. I could call her the perfectionist of the group. In any case, it was a real pleasure to work with her.', 89, '2019-12-12 18:37:05'),
(446, 51, 861, 854, 19, 'Like the rest of the group, Passakorn Kittirudeekul was a major challenge in our group work. He was very invested in his tasks. He was 100% involved in conversations and meetings and was able to help other members if necessary. I think ping really has a sense of leadership, he really knew how to impose himself when it was necessary. In any case, it was a real pleasure to work with him too.', 89, '2019-12-12 18:37:05'),
(447, 51, 861, 861, 19, 'I think that my diversity by coming from another part of the world with a different culture compared to the rest of the group has been an advantage for our team. I was able to share my point of view on how to react to the American culture that is closest to mine. I think I was able to listen to the other members of my team, to have been able to help them when they didn\'t understand something and to have imposed myself and given my opinion at every step of our work.', 89, '2019-12-12 18:37:05'),
(448, 51, 861, 862, 19, 'Chen Zhang was very active throughout the research process and during the presentation. He is a member who is 100% involved. She did not hesitate to give her opinion. I had a very interesting conversation with her about our cultural differences and how we deal with potential problems. In any case, it was a real pleasure to work with her.\r\n', 89, '2019-12-12 18:37:05'),
(449, 51, 861, 865, 19, 'First of all, Lu Jiaqi is a person who was imposed on us in our group, we didn\'t want him because of his performance last semester. We wanted to give him a chance to prove us wrong, but he showed the opposite. If I had to describe Lu Jiaqi, I would say that he is a very lazy and selfish person. During the few meetings he attended, he never gave his opinion, made suggestions or even contributed knowledge to the content of our presentation. When asked a question on the subject, he replied: \"I don\'t know, I can only help you get discounts on clothes and play in the casino\". In addition, at certain times, he preferred to go shopping rather than come to the meeting. We were very disappointed with his performance during the presentation, as he was clearly asked to learn his text during rehearsals and not to read his notes, which he obviously did not do. To conclude, Lu Jiaqi never participated in the production of this presentation, since it was even Passakorn Kittirudeekul who wrote his script for him.\r\n', 89, '2019-12-12 18:37:05'),
(450, 50, 862, 853, 19, '8', 89, '2019-12-12 19:17:26'),
(451, 50, 862, 854, 19, '8', 89, '2019-12-12 19:17:26'),
(452, 50, 862, 861, 19, '8', 89, '2019-12-12 19:17:26'),
(453, 50, 862, 862, 19, '8', 89, '2019-12-12 19:17:26'),
(454, 50, 862, 865, 19, '5', 89, '2019-12-12 19:17:26'),
(455, 51, 862, 853, 19, 'She has s deep understanding with theories. Also be a good connection in the team. I am admire that she did so much research for her work. Very good work and communication skills. I wish I would work with her maybe in someday.', 89, '2019-12-12 19:17:26'),
(456, 51, 862, 854, 19, 'I got a lot of advices from Passkorn. Very strict  and helpful partner. He always has wonderful ideas about work. And did so much distribution to the slides. It is a wonderful experience to work with him.', 89, '2019-12-12 19:17:26'),
(457, 51, 862, 861, 19, 'Excellent work! Marie did a lot of work. She has a clear plan about assignment and good skills. A good partner to work with.', 89, '2019-12-12 19:17:26'),
(458, 51, 862, 862, 19, 'I have understood motivation and culture theory deeply with applying them to real world case. And the methods to pick useful resource from thousands. I have learned a lot of things from my group members, for example, how to organise information.I believe that will help me a lot in the future.', 89, '2019-12-12 19:17:26'),
(459, 51, 862, 865, 19, 'For this presentation, he has no distribution at all. In every meeting we had, he was always with his phone. And asked a lot of questions that were not relate to our work. From that, I have to wonder if he knows our task or not. Depends on that, we had no trust on him. Very bad presentation skills. Although we have given him some advices, he had no progress on that.', 89, '2019-12-12 19:17:26'),
(460, 50, 844, 802, 19, '5', 82, '2019-12-13 01:42:26'),
(461, 50, 844, 839, 19, '6', 82, '2019-12-13 01:42:26'),
(462, 50, 844, 843, 19, '7', 82, '2019-12-13 01:42:26'),
(463, 50, 844, 844, 19, '8', 82, '2019-12-13 01:42:26'),
(464, 51, 844, 802, 19, 'Working with people from diverse backgrounds is always challenging. (Reeves, 2016). Elwalid disappeared for close to one month without any communication with the group. When contacted via the group’s WhatsApp, his response was “I have the right to get an extension”.  This shows his value for the group assignment.  On a few occasions where he and Esraa were present in the group meeting, they prefer to spend time speaking another language other than the English language, because they both speak the same language. This did not only divert attention from the primary objective of the group meeting but also lowered concentration and productivity considerably.  According to Sugimoto et al., (2019) teamwork is distinguished by collaboration, welcoming others and be adaptive. If Elwaid was committed to the group work our work would have been better', 82, '2019-12-13 01:42:26'),
(465, 51, 844, 839, 19, 'He should learn to speak up, especially on issues that concern him because in the world of today nobody will speak for you if you don\'t speak for yourself. Management scientists are known to be vocal concerning issues of people because the study of human behaviour in an organisation resides in the management sciences. (Erasmus, 2018). Nobody will speak for you, if you don\'t speak for yourself or speak out about someone\'s improper attitude, he will think he is doing the right thing. According to Erat (2012); the best thing one can do in teamwork is to make the best of it.', 82, '2019-12-13 01:42:26'),
(466, 51, 844, 843, 19, 'Esraa handled her part of the assignment and placed it on the shared PowerPoint slides. But she was always absent from lectures which affected most of the feedback we received from the tutor because she was not willing to act on the feedback and prefer to have a private meeting with the tutor. One vital tool in managing people is the skills of listening to other people\'s views, (Brookes et al., 2016) this she needs to improve on because feedback is necessary for leading others.\r\nAccording to Kovalchuk (2019), time management is essential to attaining a goal, Esraa should try to improve on her time management, she was always late to all the group meetings she attended and good at giving a late minute excuse for not attending some meetings.\r\n', 82, '2019-12-13 01:42:26'),
(467, 51, 844, 844, 19, 'According to Perlman, (2018), the environment one finds himself dictate his goals because naturally, man love to explore. This unit’s assignment has exposed me to some of the challenges in managing people. For instance, I arrived very early for most of the meetings even with the persistent and sometimes complete absence of other members of the group.\r\nMy input to the assignment includes but not limited to writing Kellogg’s Introduction both in UK and India which was assigned to me initially, in addition, I wrote the Hofstede’s theory which was originally assigned to Chinazor a former member of the group and also wrote the National culture, part of the McGregor’s content theory, critical evaluation of the theories and the conclusion. All these and other intangible things I did with enthusiasm because of my training as a university teacher in my country. One of my aims in this assignment was to improve my interpersonal relationship skills which I achieved. I created a WhatsApp group immediately after our first meeting to ease communication and also created the PowerPoint slides shared to make everyone put in their contribution from the comfort of their home.  ', 82, '2019-12-13 01:42:26'),
(468, 50, 826, 806, 19, '8', 85, '2019-12-13 03:14:45'),
(469, 50, 826, 824, 19, '8', 85, '2019-12-13 03:14:45'),
(470, 50, 826, 826, 19, '8', 85, '2019-12-13 03:14:45'),
(471, 50, 826, 836, 19, '8', 85, '2019-12-13 03:14:45'),
(472, 51, 826, 806, 19, 'He was the one in charge of the research part. He found a lot of useful theories and journal. He is also good with analyze and his very dedicated to very things he does. And since he is a teacher back home, he is also good with explanation and has some good communication skills', 85, '2019-12-13 03:14:45'),
(473, 51, 826, 824, 19, 'Although, she was a lit bit lost at the beginning, Trang worked hard for this presentation. The think that I liked about her was that she is optimistic and cheerful characters, She is also a very dedicated and persevering person: when something was wrong, she was re-doing it until it was right.', 85, '2019-12-13 03:14:45'),
(474, 51, 826, 826, 19, 'Managing People was a tough assignment that consume a lot of time, However, me and my team has done the maximum and put a lot of effort in it. I am a finisher so I was more investing through the end, I helped everyone with its part and contributed to the design of the powerpoint.', 85, '2019-12-13 03:14:45'),
(475, 51, 826, 836, 19, 'He is gifted with his communication skills, He is someone who is very diplomatic and very enthusiastic. That is why he was the one who motivated the team when we were tired. He is also someone who is attentive to details. I think he can be a good leader.', 85, '2019-12-13 03:14:45'),
(476, 50, 885, 882, 19, '6', 81, '2019-12-13 03:39:30'),
(477, 50, 885, 885, 19, '6', 81, '2019-12-13 03:39:30'),
(478, 50, 885, 888, 19, '6', 81, '2019-12-13 03:39:30'),
(479, 50, 885, 894, 19, '6', 81, '2019-12-13 03:39:30'),
(480, 51, 885, 882, 19, 'Hamida is an interesting character, very funny and she made all our group meetings very interesting but also very serious in executing her task given to her. She executed them perfectly. It is very hard to find something negative because she did what was expected of her. She gave ideas when she had to. If there is anything, I think she has to improve on it will be her presentation skills as she speaks very fast and sometimes a little nervous and also communicating her thoughts. Overall, a good team player with an interesting personality and very easy to work with.', 81, '2019-12-13 03:39:30'),
(481, 51, 885, 885, 19, 'I noticed I have improved on the way I research for materials, I normally give up after reading a few lines, especially when I don’t find what I am looking for. I went deeper this time and also researched for more articles. My confidence level has shot up and better as compared to other groups as I was given the chance to play a key role. Any information I found was used, whether it had little information or not. Due to consistent group practice I was able to build up my confidence as I was corrected. I enjoyed working with my group.', 81, '2019-12-13 03:39:30'),
(482, 51, 885, 888, 19, 'Olga is another interesting and hardworking person but more of a leader. She took it upon herself to remind us of group meetings by posting in the group platform, sharing individual task to the group. She also made sure she was always present for group meetings and did whatever was expected of her. She is very confident, and her presentation skills is very good. The only thing that can be done about her presentation skills is to slow down a little bit. Olga made sure everybody had something to bring to the table which made everyone feel involved, which I think is very good and a good characteristic of a leader. Pleasure working with her as well. ', 81, '2019-12-13 03:39:30'),
(483, 51, 885, 894, 19, 'Very hardworking, especially with finding relevant information for the group work. Always on time for group meetings and very good in suggesting new ideas that can help the group. Almost contributed more than we did but I think it motivated us to work harder in terms of individual tasks in order to catch up. Also, Achraf is very easy to work with because he is very understanding. He reminded us all as time went on to always reference our points. The only think Achraf should work on is his presentation skills, specifically communicating his thoughts to the audience. It was a pleasure working with him.', 81, '2019-12-13 03:39:30'),
(484, 50, 856, 851, 19, '10', 86, '2019-12-13 03:43:01'),
