(488, 50, 856, 864, 19, '10', 86, '2019-12-13 03:43:01'),
(489, 51, 856, 851, 19, 'Samantha is an extraordinary person, so creative and so active that brought to the group always the will to commit more and more and even risking applying new ideas, just following her natural flow of ideas. I really think that she has a great future ahead and she will do great things. She took care of the limitations and future research part, discovering all the issues and all the solutions for suture research giving an overall overview of our work. She has always been committed to our group, showing up on time and doing her job promptly and also helping others. I found not just a peer but friend like all the members of the group.', 86, '2019-12-13 03:43:01'),
(490, 51, 856, 855, 19, 'I would say that Ana represents the mom of the group, always taking care of us personally and giving us mature advices but also letting us free to take our own decisions to learn how to make mistakes and how to find a solution for that. She in an extremely hard working, despite her commitment with her children and her home. She did an outstanding speech during our presentation that even us, knowing the speech, were surprised and pleased. She taught us something not just about the study but also about life.', 86, '2019-12-13 03:43:01'),
(491, 51, 856, 856, 19, 'Thanks to my team, I have learnt how to work in group in harmony and with a strong commitment on what we were doing. I have improved my management skills not just about group work but also in my personal life managing a full-time work and full-time study delivering always a good work and being always on time with my deadline but mostly important delivering always a great result. I have been working on the cultural differences from which I have acknowledged how different is our world and how many factors may influence our life and our work environment, being very curious and passionate to learn more.', 86, '2019-12-13 03:43:01'),
(492, 51, 856, 857, 19, 'Jessica represent the fresh air in our group. Always present and engaged with her positive attitude and always willing to work hard. For the presentation she took care in an amazing way of the Company, discovering such useful information that brought us to a superior level. She and Samantha took care of putting together the final slides making sure all matched and had a creative edge. The final work was simply perfect thanks to her efforts.', 86, '2019-12-13 03:43:01'),
(493, 51, 856, 864, 19, 'Marjeta is an impressive person, always dedicated to her job with all mind and body. No matter what task she would have, she would make it as her priority giving all the ideas. She took all the minute meetings for us, taking note of every single details to deliver a perfect work. The day of the presentation despite the cold she showed up giving an outstanding presentation, as usual. I would say that she is an hard worker but mostly she is a very good friends.', 86, '2019-12-13 03:43:01'),
(494, 50, 889, 881, 19, '8', 80, '2019-12-13 04:44:42'),
(495, 50, 889, 883, 19, '8', 80, '2019-12-13 04:44:42'),
(496, 50, 889, 887, 19, '8', 80, '2019-12-13 04:44:42'),
(497, 50, 889, 889, 19, '8', 80, '2019-12-13 04:44:42'),
(498, 51, 889, 881, 19, 'I think everyone did his part very well, at the beginning we all have some struggle figuring out the process and had some problems. However, we managed to resolve the different situations. I don’t have specific information for each student because we only meet and then everyone is working for his own. In our meetings everyone was respectful and trying to help, therefore there is no one specific or notable incident. We had about 5 meetings in total which is why I gave everyone 8 because I think they did equal effort from attending the meetings and fulfilling their parts. We practiced the presentation twice and everyone were corporate. In fact, I think they all deserve 8 out of 10 regarding their contribution. I don’t have any specific critique on anyone, because we divided the whole project into 4 parts, as long as I noticed no one did something wrong. We worked individually about our specific parts and also worked as a team when putting all things together and evaluate the processes. Frankly saying, I do not recall any specific good or bad example of anyone we were equally fine, thank you.', 80, '2019-12-13 04:44:42'),
