(502, 50, 841, 814, 19, '6', 88, '2019-12-13 04:54:48'),
(503, 50, 841, 834, 19, '6', 88, '2019-12-13 04:54:48'),
(504, 50, 841, 841, 19, '6', 88, '2019-12-13 04:54:48'),
(505, 50, 841, 847, 19, '6', 88, '2019-12-13 04:54:48'),
(506, 51, 841, 814, 19, 'My colleague Mohamed gave effective contribution to get the work done not only in the introductive part he discussed during the presentation moment, but also in term of building the entire structure of the work. Very detailed oriented, he has been able to always keep the group focused on the assignment task and handbook specifications as well as spending his effort to elaborate a good layout for the presentation.', 88, '2019-12-13 04:54:48'),
(507, 51, 841, 834, 19, 'Always seeking for further meanings and implications from our readings and researches, Gideon has been crucial during the discussion. He supported the group in finding a logic flow through all the readings, and, despite the lack of specific information, he has effectively supported the group often clarifying and providing with smart intuitions. Moreover, he has a very flexible mindset that allow him to discuss the body of the work even within another theorical framework which was the Hall’s low-high context theory', 88, '2019-12-13 04:54:48'),
(508, 51, 841, 841, 19, 'I am satisfied of my contribution to the final outcome in particular because of the lack of information related to employee management in other countries. Relating HRM practises with the organisational culture in the context of a new market requires a good understanding of both cultural and business values. For this reason, I reckon I did a decent work interpreting Ford’s willingness not just to export their model in China but also adapting it in some aspects to this nex market', 88, '2019-12-13 04:54:48'),
(509, 51, 841, 847, 19, 'My colleague Rosie has done an accurate research work as  She implement many interesting ideas and hints for this presentation. Specifically focused on Ford’s organisational culture, Rosie has been able to narrow down all the information about the firm and its way of doing business relating them to its corporate culture. Furthermore, she introduced the shift in terms of culture happened within the company enlightening all the main traits in an interesting way', 88, '2019-12-13 04:54:48'),
(510, 50, 847, 814, 19, '6', 88, '2019-12-13 05:09:42'),
(511, 50, 847, 834, 19, '6', 88, '2019-12-13 05:09:42'),
(512, 50, 847, 841, 19, '6', 88, '2019-12-13 05:09:42'),
(513, 50, 847, 847, 19, '6', 88, '2019-12-13 05:09:42'),
(514, 51, 847, 814, 19, 'My colleague Mohamed gave a concrete contribution to the team. He has been able to keep the group work focused on the project, and he has always been on time for meetings, which is a sign of professionality. However, as a group we had a few issues in making decision, because he was concentrated on his ideas.\r\nUnderstanding different cultures and trying to manage them, i personally had a few arguments with him because he did not  allowed me to finish a phrase sometimes, or he preferred to impose to everyone a common way to doing the work, losing sight of our aim.  ', 88, '2019-12-13 05:09:42'),
(515, 51, 847, 834, 19, 'My colleague Gideon gave a concrete contribution to the team. He has been able to motivate the group work focused on the project. He has been always really motivated, trying to help everyone to be positive. Doing that , he contributed to keeping all of us focused. However, as a group we had a few issues in making decision, because he was absent at the meetings. Also, he was focused on his ideas, taking the project as personal challenge. Being in group work need to have a collective vision about the project, that sometimes it has been undervalued.', 88, '2019-12-13 05:09:42'),
(516, 51, 847, 841, 19, 'My colleague Adriano gave a great contribution to the team. He has been able to solves issues in the group, having always a positive vision. He has been always really motivated, trying to help everyone to be positive.\r\nHe has been fundamental in meetings, where he has always tried to make a decision with a high respect to everyone. Although, he was focused on him ideas but always ready to change opinion.\r\nThe most important thing in a group is collaborate, being focus on the common aim.\r\n', 88, '2019-12-13 05:09:42'),
(517, 51, 847, 847, 19, 'I gave a effective contribution to get the work done not only in the part discussed during the presentation, but also in terms of building the entire structure of the project. I have tried to keep organized the work and summarise in each meeting our progress as a group work. Working together is a success and only a good team can do it, and we are on the right track .\r\nBeing the only woman in the group , i not felt considered sometimes.', 88, '2019-12-13 05:09:42'),
