(22, 'Managing People Self and Peer Assessment', NULL, 'MSc', '7', 1, 5, 0, 'Sep-2019', 'This is a system to assist self-peer assessment for managing people unit. As a part of the unit assessment, you need to give yourself and peers a mark out of 10. Anyone who wants to give a mark under 4 or over 8  should discuss this first with your seminar tutor. In addition to a mark, you need to write 100-150 word comments on your and your peer\'s contribution on team the presentation. \r\n\r\nNote: you still need to submit an electronic copy of the form to Brightspace. ', 'active', 1, 794, '2019-12-02 16:24:06', '2019-12-02 16:24:06'),
