(40, 'Justificatory comments (critique): All students must provide a commentary / ‘critique’ of 100-150 words per student, outlining the reasons for awarding the marks they have.  The commentary should be sincere and evaluative, and include details and examples, where possible.  Students should reflect on the contribution and participation of each individual, as well as the quality of work produced, in relation to all stages of the work.', 'custom', 'S', 8, 1, 5, 'active'),
