(47, ' 	In addition to providing a mark, all students must provide a commentary / ‘critique’ of 100-150 words per student, outlining the reasons for awarding the marks they have. The commentary should be sincere and evaluative, and include details and examples, where possible. Students should reflect on the contribution and participation of each individual, as well as the quality of work produced, in relation to all stages of the work.', 'custom', 'S', 18, 1, 5, 'active'),
(48, 'Award yourself and your colleague a mark out of 10, on the basis of how much you feel you or your colleague contributed to the preparation, organisation and delivery of the assignment, relative to other team members. Reflect on both the quality and quantity of your input or your colleague\'s, using this scale. Any student wishing to award a mark over 8 or less than 4 must consult with the unit tutor first.', 'custom', 'R', 19, 1, 5, 'active'),
(49, 'In addition to providing a mark, all students must provide a commentary / ‘critique’ of 100-150 words per student, outlining the reasons for awarding the marks they have. The commentary should be sincere and evaluative, and include details and examples, where possible. Students should reflect on the contribution and participation of each individual, as well as the quality of work produced, in relation to all stages of the work.', 'custom', 'S', 19, 1, 5, 'active'),
(50, 'Please provide a mark between 1 to 10.  A mark of 1 means that the person has very little contribution.  A mark of 6 means the person’ contribution is the same as other members. Any student wishing to award a mark over 8 or less than 4 on the SPA rating scales must consult with the unit tutor first. When you provide the mark, please reflect critically and objectively on the contribution each person including yourself has made to the presentation. In awarding such marks, you should consider a range of criteria, including, for example, reliability, communication, enthusiasm, dedication, quality of work produced, etc.', 'custom', 'R', 22, 1, 5, 'active'),
(51, 'In addition to provide a mark, all students must provide a commentary / ‘critique’ of 100-150 words per student, outlining the reasons for awarding the marks they have.  The commentary should be sincere and evaluative, and include details and examples, where possible.  Students should reflect on the contribution and participation of each individual, as well as the quality of work produced, in relation to all stages of the work.', 'custom', 'S', 22, 1, 5, 'active'),
(52, 'Extent to which the peer offered high quality management / technical skills for the role.', 'custom', 'R', 22, 1, 5, 'inactive'),
(53, 'Award a mark out of 10 to each other member of the assignment team, indicating how much you feel each person contributed to the preparation, organisation and delivery of the assignment, relative to yourself and other team members.  You should reflect on both the quality and quantity of each individual’s input, using the following scale:\r\n8 out of 10	Student X made an outstanding contribution to the assignment, \r\n7 out of 10	Student X’s contribution was greater than most members of the team, \r\n6 out of 10	Student X’s contribution was about the same as other team members, \r\n5 out of 10	Student X contributed a little less than most members of the team, \r\n4 out of 10	Student X contributed much less than most other members of the team, \r\nless than 4	Student X contributed little, if anything, to the assignment.\r\n', 'custom', 'R', 10, 1, 5, 'active'),
(54, 'Extent to which the peer can be relied upon to carry out allocated roles / tasks.\r\n', 'custom', 'R', 16, 1, 5, 'active'),
(55, 'Comments about the peer. ', 'custom', 'S', 16, 1, 5, 'active'),
(56, 'Contribution to ideas, group plans and discussions by the peer.', 'custom', 'R', 24, 1, 6, 'active'),
(57, 'Comments about the peer. ', 'custom', 'S', 24, 1, 6, 'active');
